class ProjectHistoryCommentRequestModel {  int? manageProjectId;  int? activities;  int? page;  ProjectHistoryCommentRequestModel({this.manageProjectId, this.activities});  ProjectHistoryCommentRequestModel.fromJson(Map<String, dynamic> json) {    manageProjectId = json['manage_project_id'];    activities = json['activities'];    page = json['page'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['manage_project_id'] = this.manageProjectId;    data['activities'] = this.activities;    data['page'] = this.page;    return data;  }}